// To use your own domain name in a Distribution, you must associate a certificate
using Amazon.CDK.AWS.CertificateManager;
using Amazon.CDK.AWS.Route53;

HostedZone hostedZone;

Bucket myBucket;

DnsValidatedCertificate myCertificate = new DnsValidatedCertificate(this, "mySiteCert", new DnsValidatedCertificateProps {
    DomainName = "www.example.com",
    HostedZone = hostedZone
});
new Distribution(this, "myDist", new DistributionProps {
    DefaultBehavior = new BehaviorOptions { Origin = new S3Origin(myBucket) },
    DomainNames = new [] { "www.example.com" },
    Certificate = myCertificate
});

java.source:
// To use your own domain name in a Distribution, you must associate a certificate
import software.amazon.awscdk.services.certificatemanager.*;
import software.amazon.awscdk.services.route53.*;

HostedZone hostedZone;

Bucket myBucket;

DnsValidatedCertificate myCertificate = DnsValidatedCertificate.Builder.create(this, "mySiteCert")
        .domainName("www.example.com")
        .hostedZone(hostedZone)
        .build();
Distribution.Builder.create(this, "myDist")
        .defaultBehavior(BehaviorOptions.builder().origin(new S3Origin(myBucket)).build())
        .domainNames(List.of("www.example.com"))
        .certificate(myCertificate)
        .build();

