    DefaultBehavior = new BehaviorOptions {
        Origin = new S3Origin(myBucket),
        EdgeLambdas = new [] { new EdgeLambda {
            FunctionVersion = myFunc.CurrentVersion,
            EventType = LambdaEdgeEventType.VIEWER_REQUEST
        } }
    }
});

